Тест-система Стреп Б Стик для одноэтапного экспресс-определения антигена Бета-гемоли-тического стрептококка группы "Б" в биологическом материале человека
Экспресс-анализ  представляет собой полоску нитроцеллюлозной мембраны с фиксированными на ней специфическими моноклональными антителами, конъюгированными с коллоидальными золотыми частицами. Другие, неспецифические поликлональные антитела фиксированы в реагирующей зоне полоски мембраны. Стрептококковый антиген, содержащийся в пробе, реагирует  со  специфическими моноклональными антителами, меченными коллоидальными золотыми частицами,  формируя комплекс антиген-антитело. Образованный комплекс мигрирует вдоль полоски мембраны, образуя в реагирующей области мембраны цветную (розово-сиреневую) полоску, что указывает на положительный результат анализа. Оставшийся конъюгат продолжает мигрировать по направлению к  контрольной области мембраны, где будет  захватываться поликлональными антителами также формируя  полоску др. цвета, указывающую на правильность исполнения анализа.
КОМПЛЕКТАЦИЯ НАБОРА.
25 тестов, предназначенных  для 25 определений;
25 пластиковых одноразовых  пробиорк, установленных  в пластиковый штатив;
1 бутылочка Реагента для экстракции 1 (6,5мл);
1 бутылочка Реагента для экстракции 2 (6,5мл);
25 стерильных тампонов для сбора материала;
1 пластиковая подставка с крышкой  для исполнения анализа;
1 инструкция к применению на русском языке.
 В случае, когда немедленное исследование материала невозможно, технические возможности теста позволяют: поместить тампон со взятым материалом в сухую пластиковую пробирку и хранить при температуре в диапазоне 2-8оС в течение 48 часов после его коллекции до исполнения теста. Во время подготовки к проведению анализа, исследуемый материал содержится в холодильной камере.
Результат анализа учитывается через 5 минут после изъятия полоски из пробирки с разведенной пробой.
Чувствительность метода 88.4%,  cпецифичность 97.9%
Страна происхождения: Россия

